@BabyVampAmi Bold writers are bold people, both on page and in person.

Folks who stand on the sidelines cowering behind a veil of neutrality likely write the same.

You're the bold category, the one the mediocre envy.

@WhoThat_One_Guy It's only cliche if you're doing it to be perceived as a writer writing in a coffee shop.

It becomes pageantry if the coffee shop environment is an obvious hindrance to your task but you still choose the location.

It becomes shallow if you do it with expectations of perception.

@ProseyPosey @NatashaLink1 An author asked in a group yesterday for suggestions on why an adult daughter moved out and doesn't speak to her mother.

My suggestion was maybe the daughter simply doesn't desire contact. She's grown and moved out, that's the reason.

That should be explored I think

@Nasiim22 The King of Schlock is never modest lol, no worries there.

I'm damn good with character development and genre blending. 
I'm a horror author who has the skill to write shit that's morbid as hell and then pull out a warm and fuzzy happy ending, without contriving a damn thing.

@JosephJMiccolis 2/2
The bottom line, if your method works for you, if you're selling books and making things happen, then by all means, keep doing what works for you.

But the suggestions you present are too hyperbolic. "Sell yourself first" is a platitude at best. It's not actionable.

@JosephJMiccolis 1/2
My disagreement with your initial post was because you presented it in absolutes, demonstrating what you consider a wrong way and comparing it to what you consider a right way.

I have no reason to diminish your personal opinion, but you solicited for responses so here I am.

@JosephJMiccolis Disagree.

Readers connect to authors through our books. We aren't public entertainment personalities. We are artists that tell stories.

Our success hinges on our ability to eschew reality and create fiction. That's what brings readers to us.

@LadyBrooklynn I share this awkward struggle. 

My theory is that winking is treated as a sort of thumbs-up/nod hybrid. But it's not a hand gesture or a facial reaction. So you sort of have to coordinate it, but if it's planned it's not natural.

90% of my winks end in regret.

@DzintraSullivan Aw c'mon Dzintra now I gotta ask you what the hell feeling "punchy" means.

Is it a kangaroo with boxing gloves on? Because that'd be really nice. Maybe even a little joey in the pouch with tiny boxing gloves.

They took the kangaroo out of public schools and shit went downhill. https://t.co/7Wjy7EiGxB

@AncientLitDude 1984. Ms. PacMan at grocery. I'm being an annoying shit per the norm. My mother puts a quarter in my hand so she can shop in peace.

45 seconds. Game over. A strange compulsive need for more rises. 

It'd be 20 years before I'd discover Cocaine and upgrade to a better addiction.

@jzpitts I would summarize mine as - "trying to be Stephen King without King's talent, abilities, or creativity."
Sort of a Stephen "Pauper" tone really. 

Still buy my books though folks. Buy them hard.

