@TheSchwa1337 @PatheticLoserAB Where did you get the data that NASA's insignia is the most recognized in the world? In what context is it recognized?

The logo contains the word NASA, so anyone seeing it will automatically acknowledge its source.

But I'm pretty sure the Red Cross is way higher on the list.

@cm_blackwood It's weird how bad it bothers us. But it absolutely does. Even though folks say they don't care, I know it still sucks.

Maybe we see it as a manifestation of quantifying validity? Maybe it's just seen as reverse momentum.

Either way it sucks. And it's valid to feel that way.

@Heyman_Bigbooty Okay I just ate. Let me revisit the thread...

*Old people only like talking to me because I'm walking proof that their adult grandson named Mert who eats paint chips all day and is banned from purchasing Sudafed at all Walgreens still could have turned out worse.*

Much better.

@SangamithraNat1 Buy my horror books and I'll be really flattered and grateful. Like if you need something I got you level of appreciation.

Like if a creepy dude is in your DMs, I'll tell that ugly neckbeard to kick rocks for you. It can be whatever.

https://t.co/2COKUyjXC0

@Heyman_Bigbooty An old lady told me about virtues of the Mama Michelina frozen meals for 20 minutes at the grocery one time.

She said they were perfect for a light meal in the evening, and thus began the Gospel reading of Michelina.

She was right though. They do sit light for a starchy meal.

@LaraAnnDominick @may_carlen Most of the success stories I know are from adaptations. Stores like Slenderman that got a movie deal. 

Book deals though, I dunno. It'd be a matter of someone willing to risk their money on a hunch.

With screenwriters that's more common. Not as often for us in literature. https://t.co/OffsSvm7pS

@Viljka If you like horror, check me out! If you don't like horror, still check me out. I'm not saying my books can make you love a genre - because you'll be saying it in that bomb ass review!
(Above claims are unverified)
https://t.co/2COKUyjXC0

@MRKistlerWrites The creature holds up the face it had worn before, smiling as the mask is sways.

In a buzzing, demonic voice, "You said that wearing masks offended you. So I took mine off too. The customer is always right; so who am I to disagree!!"

Its smile widens as it advances.

@EmilyRyanAuthor I'm in a few but can't really say they're worth much. A lot of gatekeeping. A lot of arbitrary policies.
I stick around to occasionally give advice. There's some great members, but the tone of the whole is sort of pretentious.
Just don't go in with any expectations.

@DonovanEdwards Yes. Literature and Storytelling are separate art forms in the sense that they can be practiced exclusively as their own crafts.
However, the can directly augment eachother.

I'd say literature is the beneficiary of storytelling more so than the other way around.

@Fed_2001 Most of this riddle is misdirection, and I still contend that zero is a logical response - but this is fun to dissect.

I'll try one more. The answer is 1.

The observer "walks in the room," therefore only one leg is touching the ground at any given time.

@Fed_2001 Zero.

Whether animal, human, or furniture, the legs are not on the floor regardless of their position in the room or contact with the floor.

Feet touch the floor. Legs don't enter the equation.

@therealzevgood Those gatekeeper types that bring typewriters to Starbucks and feverishly await a chance to inform people that they don't own a television are going to have their world crumbled when I start saying "Irregardless."

"That's not a real..."

I inhale as I prepare to vanquish a fool.

@MRKistlerWrites The free sundae arrives. Dave wonders where the birthday song is. Nancy snaps for the waiter to come over and asks for Dave's song.

It's now 45 minutes after closing. Dave is waiting for his song.

Their pal Dan "the man" McMichaelson shouts "like a boss" for reasons unclear.

@AshTudor888 That'll only make it worse. It'll cause him to think in flat affect characterized by apathetic perception.

He'll still want to know about the paper cuts, but now his lobotomized brain will only access linear problem solving mechanisms.

He gonna cut them eyes now...

@Heyman_Bigbooty Remember King Vitamin? It was always in the store but I didn't know anyone who bought it.

I do give 'em props for hiring a legit vaudeville star to play the king.
https://t.co/J3i6Rr9zeg

