@AuthorWoodroe Better specify those four-letter words are swears or otherwise you're going to have one hell of a hard time with the dialogue. 

"Did that..." Oh wait - can't use 'that.'

"Does th..." SHIT - can't use 'does' and really can't use 'SHIT.'

@agletterman Depends. Is this publisher willing to cut a book deal? You have to assess if you're in a position to make demands. 
Are they taking a big risk on you? Are you new or established? Can you make them their money back?
It sounds cold but it's the the nature of the business.

@DzintraSullivan Honestly neither appeal to me. I'm not altruistic nor am I misanthropic.

I would say a combination of enlightened self-interest, deferred gratification, and consequentialism best define my world view.

I believe kindness is an act that should be exulted.

@BarrySBrunswick @DzintraSullivan @Ned_the_zombie @JaysQuill @Chrissy_Clarke @woodcowbooks @KeysDorian @SJTurner_Author @inkedingray @BellaRayne10 @LawrenceWriting @CRTaylorwrites @FaerieRealms @TTBanks5 @TJPayne3333 @joanne_paulson @Johnldeboer @DisparoJack @JonathanMette @bonblossman @disneymom1126 @Ltward2 @HLNida2 @MarkSagarin @ctamarketing @ZenaAZellers @xxxBJFrazier @nikki_twisted @Wordsmith66 @d_ast777 @JaysinYerxa @DebbieGrimshaw2 @HABlackwood7 @ClaireLLLW81 @lyv0n @Kungfuponder We'd struggle psychologically because the elements of positivity generally rest in "what can be" as opposed to "what is."
